"use strict";(self.webpackChunkulinkcms_doc=self.webpackChunkulinkcms_doc||[]).push([[130],{7735:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"project-release","metadata":{"permalink":"/blog/project-release","source":"@site/blog/2024-10-07-project-release.mdx","title":"UlinkCMS First Release!","description":"We are thrilled to announce the official release of UlinkCMS!","date":"2024-10-07T00:00:00.000Z","tags":[],"readingTime":1.15,"hasTruncateMarker":true,"authors":[{"name":"Marco Wang","title":"Webmaster - Developer and Algorithm Engineer","url":"https://github.com/Macw07","page":{"permalink":"/blog/authors/macw-07"},"socials":{"github":"https://github.com/Macw07","x":"https://x.com/Macw07"},"imageURL":"https://avatars.githubusercontent.com/u/87552695?v=4","key":"macw07"},{"name":"Fengting Fei","title":"Webmaster - Operator and Developer","url":"https://github.com/Fewy-FFT","page":{"permalink":"/blog/authors/fft"},"socials":{"github":"https://github.com/Fewy-FFT","x":"https://x.com/FFT"},"imageURL":"https://avatars.githubusercontent.com/u/181807991?v=4","key":"fft"}],"frontMatter":{"slug":"project-release","title":"UlinkCMS First Release!","authors":["macw07","fft"],"tags":[]},"unlisted":false},"content":":::tip[Exciting News!]\\nWe are thrilled to announce the **official release** of UlinkCMS!\\n:::\\n\\n{/* truncate */}\\n\\n<div className=\\"card-container\\">\\n  <div className=\\"card-title\\">Quick Login Interface</div>\\n  <div className=\\"button-container\\">\\n    <a className=\\"custom-button primary\\" href=\\"https://ulinkcms.com/admin-dashboard\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">Admin Login</a>\\n    <a className=\\"custom-button secondary\\" href=\\"https://ulinkcms.com/login\\" target=\\"_blank\\" rel=\\"noopener noreferrer\\">User Login</a>\\n  </div>\\n</div>\\n\\nUlinkCMS (Ulink Club Management System) has officially launched, marking a new era for club administration and management! Designed with simplicity and efficiency in mind, UlinkCMS offers club leaders and administrators the tools they need to effectively manage their clubs and members.\\n\\n**Key Features** include:\\n\\n- **Member Management**: Add and manage club members easily.\\n- **Attendance Tracking**: Club leaders can quickly track member participation over time.\\n- **Club Evaluations**: Administrators can assess clubs by assigning ratings based on engagement, success, and overall performance.\\n\\nThese features are designed to help clubs stay organized and continuously improve through real-time feedback. With just a few clicks, club leaders can manage attendance and receive evaluations, ensuring their clubs remain active and focused on growth.\\n\\nStay tuned for future updates, as we are committed to bringing more features to enhance your experience with UlinkCMS!\\n\\n:::tip[Feedback Welcome!]\\nWe are always open to feedback and suggestions. Feel free to reach out to help us improve!\\n:::\\n\\n&copy; 2024 UlinkCMS. All rights reserved.\\n\\n---\\n\\nThis version incorporates the structure and styling with some additional JSX for layout consistency, ensuring it fits well in a Docusaurus project page."}]}}')}}]);